var mongoose = require("mongoose");

var Schema = mongoose.Schema;
var itemSchema = new Schema({
  items: [{
    name: {
      type: String,
      default: ""
    },
    imageUrl: {
      type: String,
      default: ""
    },
    isObtained: {
      type: Boolean,
      default: false
    }
  }]
});
var Item = mongoose.model("Item", itemSchema);
module.exports = Item;
